import React, { useEffect, useState } from 'react';
import './terminal.css';

export const Terminal = ({ listOfThreads }) => {
    const [prompt, setPrompt] = useState('');

    const clearScreen = () => {
        // Ekrandaki verileri temizleme işlemi
        listOfThreads = [];
    }

    useEffect(() => {
        fetch('/get_prompt')
            .then(response => response.json())
            .then(data => setPrompt(data.prompt))
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <>
            <div className='terminal-container'>
                <button onClick={clearScreen}>Clear</button> {/* Clear düğmesi */}
                <div className='terminal-output'>
                    {listOfThreads.map(thread => {
                        return (
                            <ul key={thread.id}>
                                <li>{`${prompt}${thread.command}`}</li>
                                <li>{thread.output}</li>
                            </ul>
                        )
                    })}
                </div>
            </div>
        </>
    )
}
